  const addverts = { company: "", url: "", description: "" };

  return (
    <WidgetContainer>
      <Box>Sponsored</Box>
      <Box>
        <img src="" alt="advert" />
      </Box>
      <FlexBetween>
        <Box>Company</Box>
        <Box>Url</Box>
      </FlexBetween>
      <Box>Description</Box>
    </WidgetContainer>
  );
};

export default Advert;
